import { StyleSheet } from "react-native";

export const s = StyleSheet.create({
  meteo_basic: {
    flex: 2,
    backgroundColor: "red",
  },
  meteo_searchbar: {
    flex: 2,
    backgroundColor: "blue",
  },
  meteo_advanced: {
    flex: 1,
    backgroundColor: "green",
  },
});
